import React from 'react';
import Navbar from './components/Navbar';
import Home from './components/pages/Home';
import {BrowserRouter,Switch,Route,Routes} from 'react-router-dom';
import "./App.css"
function App() {
    return (
        <BrowserRouter>
        <Switch>
        <Routes>
            <Route path="/">
                <Navbar />
            </Route>
            <Route path="/home">
                <Home />
            </Route>
        </Routes>
        </Switch>
        </BrowserRouter>
    );
  }
  
  export default App;
